import React, { useState, useEffect } from 'react';
import axios from 'axios';

const UserForm = () => {
  const [user, setUser] = useState({}); // State to store user data

  useEffect(() => {
    // Fetch user data from the API on component mount
    axios.get('/api/users/1') // Replace with your actual API endpoint for user details
      .then(response => setUser(response.data))
      .catch(error => console.error('Error fetching user:', error));
  }, []);

  return (
    <div>
      <h2>User Details</h2>
      <form>
        <div className="form-group">
          <label htmlFor="login">Login:</label>
          <input type="text" className="form-control" id="login" value={user.login} disabled />
        </div>
        <div className="form-group">
          <label htmlFor="role">Role:</label>
          <input type="text" className="form-control" id="role" value={user.role} disabled />
        </div>
        {/* Add more input fields for other user data as needed */}
      </form>
    </div>
  );
};

export default UserForm;
